-- VIEWS

create or replace view CV_res (Job, Occupancy, Avg_salary) as select speciality, fulltime,  avg (salary) from cv where status = 'open' and movement = 'not ready' group by speciality, fulltime order by speciality

create or replace view users_res as select  TIMESTAMPDIFF(year, birthday, now()) as age , count(TIMESTAMPDIFF(year, birthday, now())) as user_amount from users where gender = 'm' group by age order by user_amount desc


-- PROCEDURE

-- search of vacancies, matching CV:
--- 1) same speciality + higher salary
--- 2) same hometown of user (CV creator) and company (vacancy creator)

drop procedure if exists vacancy_match;
delimiter //
create procedure vacancy_match (in for_CV int)
begin
	
	-- speciality match
select v.id from cv
join vacancy v
on cv.speciality = v.speciality
where cv.id = for_CV
and cv.salary <= v.salary
union
	-- hometown match
select vc.id from cv
join users u
on u.id = cv.user_id
join (select v.id, c.location from vacancy v join company c on c.id = v.company_id) as vc
on vc.location = u.hometown
where cv.id = for_CV;

end//
delimiter ;

call vacancy_match(2)



